			<link>http://hangar18.com.ar/?topic=13034</link>
			<description><![CDATA[<div align="center"><img onload="if(this.width >720) {this.width=720}" id="imagen" src="http://www.metal-archives.com/images/1/5/0/150_logo.jpg" border="0" /><br /><br /><br />Diez temas grabados ya hay para el álbum 2011 de AMON AMARTH, &quot;Surtur Rising&quot;, cuyo lanzamiento está fijado para el 29 de marzo del 2011, a cargo nuevamente de Metal Blade Records.<br /><br />El vocalista Johan Hegg señaló con respecto al material: &quot;Quisimos ponerle un poco más de filo al sonido, así que espero que eso salga una vez hecha la mezcla y todo. Tenemos diez pistas y, como es lo usual para nosotros, todas aparecerán en el álbum&quot;.<br /><br />Como lo fue con &quot;With Oden On Our Side&quot; (2006) y &quot;Twilight Of The Thunder God&quot; (2008), AMON AMARTH recurre ahora a los estudios de Jens Bogren (KATATONIA, OPETH, PARADISE LOST), para registrar las tomas de este disco.<br /><br /><img onload="if(this.width >720) {this.width=720}" id="imagen" src="http://img801.imageshack.us/img801/4099/header31.jpg" border="0" /><br /><br />Fuente: <a href="http://www.rockaxis.cl/article_info_metal.php?articles_id=13220&amp;osCsid=79d6025b8b802800329a630811775ae1" target="_blank" rel="nofollow">http://www.rockaxis.cl/article_info_metal.php?articles_id=13220&amp;osCsid=79d6025b8b802800329a630811775ae1</a></div>...]]>
