			<link>http://hangar18.com.ar/?topic=13032</link>
			<description><![CDATA[<div align="center"><br /><span style="font-size: 12pt; line-height: 1.3em;"><b>Misëriä y Muërtë - its Thrashing and Grinding</b> </span><br /><br /><img onload="if(this.width >720) {this.width=720}" id="imagen" src="http://i56.tinypic.com/10msg0n.jpg" border="0" /><br /><br /><b><span style="font-family: Trebuchet MS;">Miseria y Muerte se formo en el verano de 2005 dado a las ganas de hacer ruido. Y luego de varias formaciones, la banda se estabilizo con la formacion de brian en los gritos,Nikojarcarton en la bateria y los que siempre estuvieron desde los comienzos,Mati en la guitarra,Pinwi en el bajo. Luego de unos cuantos meses de subirse al escenario a gritar algun que otro tema &quot;el miseria fantasma&quot; como brian le apodo, entro a cantar como segunda voz pablo alias &quot;grititos de mujer&quot; a principios de año del 2009.Ese mismo año, en el mes de octubre, brian se separa de la banda y queda pablo solo en las voces. Hoy en dia la formacion permanece de esa manera, con cuatro integrantes , sufriendo una metamorfosis en cuanto al sonido dando un giro hacia un sonido un poco mas black y expermentando con nuevos temas y estilos.</span></b><br /><br /><span style="font-size: 12pt; line-height: 1.3em;"><span style="font-family: Trebuchet MS;">Suena como:</span></span> SLAYER,DEATH, TRAGEDY, EKKAIA, CRADLE OF FILTH, DARK THRONE, ORDER TO VULTURE, RATOS DE PORAO , NAUSEA, POR CITAR ALGUNAS<br /><br /><hr width="50%"><br /><span style="font-size: 12pt; line-height: 1.3em;"><b>Misëriä y Muërtë - Revolviendo Nuestro Terror [EP]</b> </span><br /><br /><img onload="if(this.width >720) {this.width=720}" id="imagen" src="http://i52.tinypic.com/2uqyfbt.jpg" border="0" /><br /><br /><span style="font-family: Lucida Sans;">1. Murder<br />2. Teocidio, la caida del paraiso<br />3. Escondido en la oscuridad<br />4. All humans are waste<br />5. Dark City<br />6. Hell is real<br />7. Desolación<br />8. Revolviendo nuestro terror<br />9.Edén de la Misantropía<br />10.xxxx<br />11.El poder corrompe<br />12.Earth A.D (Misfits)</span><br /><br /><hr width="50%"><br /><a href="http://www.mediafire.com/?mxczyfyu29434yn" target="_blank" rel="nofollow">http://www.mediafire.com/?mxczyfyu29434yn</a><br /><b>37.86MB</b><br /><i>@128kbps</i><br /><br /><hr width="50%"><br /><img onload="if(this.width >720) {this.width=720}" id="imagen" src="http://i52.tinypic.com/2aj281d.jpg" border="0" /><br /><br /><hr width="50%"><br /><img onload="if(this.width >720) {this.width=720}" id="imagen" src="http://i51.tinypic.com/ilzxiq.gif" border="0" /><br /><br /><hr width="50%"><br /><a href="http://img186.imageshack.us/i/abbathpoint.jpg/" target="_blank" rel="nofollow"><img onload="if(this.width >720) {this.width=720}" id="imagen" src="http://img186.imageshack.us/img186/9658/abbathpoint.jpg" border="0" /></a><br /></div>...]]>
